function DessertsList(props) {
    const lowCaloriesDesserts = props.data
    .filter ((dessert) => {
        return dessertCalories < 500;
    })
    .sort ((a,b) => {
        return a.calories - b.calories;
    })
    .map ((dessert) => {
        return (
            <ul>
                <li> ${dessertName} - ${dessertCalories} cal </li>
            </ul> );
    } );

    return <ul>{lowCaloriesDesserts}</ul>

  }

